  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`link_id`),
  KEY `is_check` (`is_check`),
  KEY `link_sort` (`link_sort`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='友情链接表';

